import React from 'react';
import  s from './Counter.module.css'

type CounterType ={
  inc:()=>void
  reset:()=>void
    disable:number
    StartValue:number
}


export const Counter = (props:CounterType) => {


    const Inc =()=> {
        props.inc()
    }

    const Reset =()=> {
        props.reset()
    }

    return (
        <div className={s.around_wrapper}>
           <div className={props.StartValue>=props.disable ? s.error :''}>{props.StartValue}</div>
            <div className={s.around}>
                <button onClick={Inc} disabled={props.StartValue>=props.disable} >inc</button>
                <button onClick={Reset}>reset</button>
            </div>

        </div>
    );
};
